style.css:
@-moz-document domain("roblox.com") {
/* Apply a background image to the entire page */
    body {
        background-image: url("https://images2.alphacoders.com/125/1256398.jpg") !important;
        background-size: cover !important;
        background-repeat: no-repeat !important;
        background-attachment: fixed !important;
        background-position: center center !important;
        margin: 0 !important;
        padding: 0 !important;
    }

    /* Customize the color of text for readability */
    body, p, h1, h2, h3, h4, h5, h6 {
        color: #ffffff !important; /* White text color */
    }

    /* Adjust the transparency of any elements on the page */
    div, section, article, aside, footer, header, nav {
        background-color: rgba(0, 0, 0, 0.7) !important; /* Black background with 70% transparency */
    }

    /* Remove any other background images on the page */
    * {
        background-image: none !important;
    }
}
